import React,{useState,useEffect} from 'react';
import Card from 'react-bootstrap/Card';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import { Link } from "react-router-dom";
import { Required } from '../../utilities/validator';

function Add(props) {

    const [Form_data, setForm_data] = useState({
        name:{
            value:"",
            isValid:null,
            error:"",
            rules:["required"]
        },
        author:{
            value:"",
            isValid:null,
            error:"",
            rules:["required"]
        },
        price:{
            value:"",
            isValid:null,
            error:"",
            rules:["required"]
        }
    })

    const setFormData=(name,value)=>{
        setForm_data(state=>{
            let newState={...state};
            newState[`${name}`]['value']=value;
            return newState;
        });
        Form_data[`${name}`]=value;
        console.log(Form_data);
    }

    const validate = ()=>{
        for (const key in Form_data) {
            if (Object.hasOwnProperty.call(Form_data, key)) {
                const element = Form_data[key];
                // console.log(element);
                check_rules(element.rules,element.value,key);
                
            }
        }
    }


    const check_rules=(rules,value,name)=>{
        rules.map((rule)=>{
            let [rule_string,argument]=rule.split(":");
            switch (rule_string) {
                case "required":
                     let result=Required(value);
                     setForm_data(state=>{
                        const newState = {...state};
                        result==false?newState[`${name}`].isValid=false:newState[`${name}`].isValid=true;
                        result==false?newState[`${name}`].error=`${name} is Mandatory`:newState[`${name}`].error="";
                        return newState;
                     })
                     console.log(Form_data);
                    break;
            
                default:
                    break;
            }
        })
    }

    const onFormSubmit=()=>{
        validate();
    }


    useEffect(() => {
      
    
      return () => {
        
      }
    }, [])

    return (
        <>
            <div className="container mt-5">
        
                <Card style={{ width: 'auto' }}>
                    <Card.Header>
                        <div className="row">
                            <div className="col-md-6">
                                <Card.Title className='mt-2'>Create New Book</Card.Title>
                            </div>
                            <div className="col-md-6">
                                <div className="d-flex justify-content-end">
                                    <Link to={'/books'}>
                                        <button className='btn btn-primary'>Back</button>
                                    </Link>
                                </div>
                            </div>
                        </div>
                    </Card.Header>
                    <Card.Body>
                        <Form>   
                            <Form.Group className="mb-3" controlId="formBasicEmail">
                                <Form.Label className='font-weight-bold'>Name</Form.Label>
                                <Form.Control type="text" name='name' onInput={(e)=>{setFormData(e.target.name,e.target.value)}} placeholder="Enter Book Name.." />
                                    {Form_data.name.error!=""?
                                        <Form.Text className="text-danger">
                                            {Form_data.name.error}
                                        </Form.Text>
                                    :
                                    null
                                    }
                                    
                            </Form.Group>
                            <Form.Group className="mb-3" controlId="formBasicEmail">
                                <Form.Label className='font-weight-bold'>Author</Form.Label>
                                <Form.Control type="text" name='author' onInput={(e)=>{setFormData(e.target.name,e.target.value)}} placeholder="Enter Author Name.."  />
                                    {Form_data.author.error!=""?
                                            <Form.Text className="text-danger">
                                                {Form_data.author.error}
                                            </Form.Text>
                                        :
                                        null
                                    }
                            </Form.Group>
                            <Form.Group className="mb-3" controlId="formBasicEmail">
                                <Form.Label className='font-weight-bold'>Price</Form.Label>
                                <Form.Control type="number" name='price' onInput={(e)=>{setFormData(e.target.name,e.target.value)}} step={0.01} placeholder="Enter Price.."  />
                                    {Form_data.author.error!=""?
                                                <Form.Text className="text-danger">
                                                    {Form_data.author.error}
                                                </Form.Text>
                                            :
                                            null
                                    }
                            </Form.Group>
                            <Button variant="primary" onClick={()=>{onFormSubmit()}}>
                                Submit
                            </Button>
                        </Form>
                    </Card.Body>
                </Card>
            </div>                    
        </>
    );
}

export default Add;
